 &quot;Dva Bobra&quot;, on the shores of picturesque Lake cabins are a fisherman, where you can rent pavements for fishing. Around the lake are 11 altanok - is the perfect place for those who like to cook barbecue on your taste, and you can place an order from a restaurant. For your holiday has everything you need - BBQ, grill grid, table, comfortable benches.</p>\r\n\r\n<p>The complex offers specialized sports fields, where you can actively spend your holidays and enjoy the game of volleyball or soccer. Everything you need can be rented - balls, nets and other sports equipment. The complex offers to the beach at the lake. On each of the beaches have everything you need for your stay - changing rooms, showers, toilets, and you can rent chairs, towels, beach mattresses and other accessories.</p>\r\n\r\n<p>Vacation complex &quot;Dva Bobra&quot; is perfect for outdoor activities: crazy golf, paintball, soccer, volleyball, archery, badminton, skiing, ATV and fishing.</p>\r\n','2013-03-12 12:51:22','2013-03-18 17:33:52'),(115,39,'ua','','<p>Chillout /  -        .          .</p>\r\n','2013-03-12 12:57:17','2013-03-18 17:31:56'),(116,39,'ru','','<p><em style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica; line-height: 18px;\"><strong>Chillout / </strong></em><span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica; line-height: 18px;\">&nbsp;&mdash;&nbsp;       .          .</span></p>\r\n','2013-03-12 12:57:17','2013-03-18 17:22:18'),(117,39,'en','Chillout','<p>Chillout / Chill - a great place to relax with friends and acquaintances. The cozy atmosphere and unique cuisine create an atmosphere of comfort and spontaneity.</p>\r\n','2013-03-12 12:57:17','2013-03-18 17:31:56'),(118,40,'ua','','<p>  (Tampopo) -     &laquo;&raquo; -       , ,   .                &#39;.   ,          .</p>\r\n\r\n<p>   -        .    .        (, , ),    . -    ,    .  -  -.             !   (Tampopo)    ,    ,      : - &laquo;   &raquo;, - &laquo; -   &raquo;, - &laquo;    &raquo;.</p>\