 White&quot;</strong> restaurant!</p>\r\n\r\n<p>Entwinement of the Oriental philosophy, modesty, nobility and subtle mystery gives to this place a really magic appeal. &nbsp; Each out of 7 halls seems to hide an invisible secret which is for a Guest to find out.&nbsp;</p>\r\n\r\n<p>Deep scarlet color pervades in Ogon&rsquo; Hall (for 22 persons), suggesting to wrap yourself up in the desire and sensation environment. Intricate hieroglyphic symbols in Kalligraphia Hall (for 16 persons) will impress you with the strong charm of the most ancient Chinese art. Elegant Tsvety Hall (for 32 persons) will fascinate real romantic people with delicate flavor of lightness and comfort. Risovyi Hall (for 24 persons) reveals the harmony of the land of the rising sun. Ideal place for those who prefers Japanese concept views. In Imperatorskyi Hall (for 24-36 persons) reserved luxury and the atmosphere of the genuine mightiness of China dominate. &nbsp;Barhatnyi Hall (for 24-36 persons) &nbsp;wraps you into stately chic inviting you to &nbsp;put away your routine troubles for a while. Fabulous Soglasiya Hall (for 14 persons) will give you calmness, power and success.</p>\r\n\r\n<p>Fans of vocal entertainment will be pleased with &nbsp;the professional PRO Evolution &nbsp;karaoke system with a huge number of hit records combining several hundreds of &nbsp;thousands of audio tracks.</p>\r\n','2013-03-12 16:49:48','2013-03-17 17:12:10'),(337,113,'ua','','<p>  Dragee / &nbsp;        -,   .    ,       ,  -       -    ,        &#39;    ,     .    Drage  -   ,      &laquo;InteresniKazki&raquo;.</p>\r\n\r\n<p>  /&nbsp;Dragee&nbsp;    ,              .          ,  .</p>\r\n\r\n<p>     /&nbsp;Dragee   .    - -   &#39; , -     ,      ,  ,   ,          .</p>\r\n\r\n<p>, ,       -   &laquo;Dragee&raquo;   ,    .</p>\r\n\r\n<p>     /&nbsp;Dragee -   .       .     ,   ,       -       .     -  ,    &laquo;Dragee&raquo;  ,       ,       .</p>\r\n','2013-03-12 16:52:18','2013-03-18 14:05:44'),(338,113,