icious khachapuri, &nbsp;chachochbili, shashlyk, lula kebab magically appear&hellip; Besides, there are many other dishes the names of which are pleasant for an ear and &nbsp;awake the appetite!</p>\r\n\r\n<p>&quot;Come in, dear, be my Guest!&quot;</p>\r\n','2013-03-12 17:00:09','2013-03-17 16:19:06'),(361,121,'ua',' ','<p>  -    ,     ,   ,     ,     . ,      ,    ,     ,     .    ,   , -      .</p>\r\n\r\n<p>      ,      .     ,    , - -.        -    .         ,   &#39;   .         .       .   &laquo; &raquo;        .    -,      ,       .</p>\r\n\r\n<p>         . ,  ,  , , , ,       &laquo; &raquo;  ,    -   ,    .</p>\r\n','2013-03-12 17:00:09','2013-03-18 13:41:48'),(362,121,'ru',' ','<p><strong> </strong> &mdash;    ,     ,   ,     ,     . ,      ,    ,     ,     .     ,   , -      .</p>\r\n\r\n<p>       ,      .     ,    , - - .        -     .   <strong>  </strong>    ,      .         .       .   &laquo; &raquo;        .    -,      ,       .</p>\r\n\r\n<p>         . ,  ,  , , , ,       &laquo; &raquo;  ,    &ndash;    ,    .</p>\r\n','2013-03-12 17:00:09','2013-03-17 16:07:00'),(363,121,'en','Dvor Goloseevskiy','<p>Dvor Goloseevskiy - is a huge restaurant complex, located near the city center, in a green, quiet and peaceful corner of Kiev, in a beautiful nature Holoseievski forest. The feeling that you are far from the city, enjoying the peace and nature, does not leave from the moment you cross the threshold of the complex. Enclosed and secluded area, like a castle - a guarantee of comfort and lack of city life.</p>\r\n\r\n<p>The restaurant&#39;s menu will satisfy the desires of the most demanding gourmet foodie, hitting its variety of dishes of Caucasian cuisine. Unable to abandon fragrant khachapuri appetizing and savory satsivi, kebab is Caucasian. A local kebabs on Armenian and avtrskim recipes-some of the best in the city. Each dish of the restaurant is a small Dvor Goloseevskiy work of art created with love masters of their dela.Otdelno worth noting fragrant oriental hookahs and various alcoholic card. Wine lovers await proposals from the best manufacturers. Evening territory &quot;Court Holoseievski&quot; immersed in the latest fashion trends and musical culture. The restaurant played DJs, distributed funny and fiery gypsy melodies and romantic sounds of the violin to make the evening memorable.</p>\r\n\r\n<p>We love to receive visitors and kind to all requests. Banquet, business meeting, corporate event, reception, presentation, conference, secular party or family celebration in the &quot;Dvor Goloseevskiy&quot; will be festive, unique and unforgettable - exactly such as you would like.</p>\r\n','2013-03-12 17:00:09','2013-03-18 13:41:48'),(364,122,'ua',' i','<p>   &quot;&quot;      &#39;   .     ,     ,      .</p>\r\n\r\n<p> ,      .       ,  ,  ,  .</p>\r\n\r\n<p>,   &quot; &quot;  ,  ,   .</p>\r\n','2013-03-12 17:01:59','2013-03-18 13:40:01'),(365,122,'ru',' ','<p>  <strong> &quot;&quot;</strong>         .     ,     ,      .</p>\r\n\r\n<p> ,      .       ,  ,  ,  .</p>\r\n\r\n<p>,  <strong> &quot; &quot;</strong>  ,  ,   .</p>\r\n','2013-03-12 17:01:59','2013-03-17 16:06:19'),(366,122,'en','Trattoria Piza','<p>A cozy pizzeria &quot;Trattoria&quot; and plunge into the sun and the soft world of real Italy. Whatever you do, wherever you are, a piece of Italy will always be available to you.</p>\r\n\r\n<p>Classic pizza, for your convenience, divided by region. Here you can taste the Roman pizza, Neapolitan pizza, pizza Venice, Milan pizza.</p>\r\n\r\n<p>Also, in the &quot;Trattoria Pizza&quot; a variety of salads, entrees, drinks and desserts.</p>\r\n\r\n<div>&nbsp;</div>\r\n','2013-03-12 17:01:59','2013-03-18 13:40:01'),(367,123,'ua','','<p><strong>&quot;&quot;</strong> -     ,      .   ,        -   .</p>\r\n\r\n<p><strong>&quot;&quot;</strong>    ,        .  ,        , ,  :         ,     XXI .      -     ,          .</p>\r\n\r\n<p>      &quot;  &quot;,             .        :     ,     ,   &quot;&quot; -       .