. 3D mapping is already well known in Ukraine and continues to gain popularity.</p>\r\n\r\n<p>In Maskano Bar are European dishes prepared with only organic products and purified water. The quality of ingredients is carefully controlled and is especially proud of the restaurant.</p>\r\n','2013-03-12 17:07:35','2013-03-18 13:29:20'),(382,128,'ua','','<p>      .    :    ,   ,      ,       .            ,          .</p>\r\n\r\n<p>-  -    ,           .  ,   ,         .  -             -    ,      .        -: ,          .     ,      .</p>\r\n\r\n<p>   -        .  ,        ,      ,    ,      .</p>\r\n','2013-03-12 17:09:41','2013-03-18 13:27:06'),(383,128,'ru','','<p>      .    :    ,    ,      ,       .            ,          .</p>\r\n\r\n<p><strong>- </strong> -    ,           .  ,   ,         .               &ndash;  <strong></strong>  ,      .        -: ,          .     ,      .</p>\r\n\r\n<p>  -        .  ,        ,       ,    ,       .</p>\r\n','2013-03-12 17:09:41','2013-03-17 15:59:14'),(384,128,'en','Pushustuy','<p>In Japanese culture, aesthetics is the basis of life. It manifests itself in everything: the search for beauty in simple, impeccability in detail, love for strong and clear forms, particular attitude to every second of one&rsquo;s own time.</p>\r\n\r\n<p>For a person from another cultural background this approach can be both surprise and delight, because it is only in the Japanese world view each detail is crucial.</p>\r\n\r\n<p><strong>Sushi Bar &quot;Pushistiy&quot;</strong> &ndash; the best Japanese restaurant in Kiev, which fully embodies the Oriental idea of a healthy diet and life harmony. The culinary tradition of the country of the rising sun has reflected in a little, at first glance, room. From anywhere in the restaurant, you can freely watch the magic of making real sushi &ndash; <strong>&quot;Pushistiy&quot;</strong> has an open kitchen, as required by the rules of Oriental etiquette. The chef personally controls the selection of products for the restaurant: it is believed that the freshness of ingredients is the key to the Cuisine of the island of Japan. So you can be sure that <strong>&quot;Pushistiy&quot; </strong>serves only the best.</p>\r\n\r\n<p>The atmosphere reigning in the sushi bar is pleasant for meeting with loved ones. It does not matter whether you come alone or in a large group of friends, every detail of the restaurant will contribute to the necessary mood and the staff will do everything in order such meetings occur as often as possible.</p>\r\n','2013-03-12 17:09:41','2013-03-17 15:59:14'),(385,129,'ua',' ','<p>     ,      ,     &#39;   ,    <strong>&quot; &quot;</strong>.      , , ,    ,     - ,          ,    ,       .</p>\r\n\r\n<p>     &#39; ,   ,      ,      .   &quot; &quot; &#39;     (  ,      ,     ) ,     .   ,        ,   .</p>\r\n\r\n<p>&quot; &quot;   :    ,        ,    ,      .    -     , ,   .   ,  ,    .    :  &#39;,    ,         (   &quot;&quot;   -!),    ,  ,  ,   &quot;&quot;,     -   -      !</p>\r\n\r\n<p>   &quot; &quot;        ,    ,  .  - &quot;   !&quot;</p>\r\n','2013-03-12 17:10:08','2013-03-15 18:47:54'),(386,129,'ru',' ','<p>  <strong>&quot; &quot;</strong>              &nbsp;.      ,      .    ,    ,       ,  ,  ,      .      ,     ...         ,       ,  .</p>\r\n\r\n<p>       .   &quot; &quot;     Josper.    ,  , -  , -     ,   - .    &nbsp;   ,   -,  ,    -,     ,   -... ,  ,      &quot; &quot; -  &quot;-&quot;,    .</p>\r\n\r\n<p> -   .        &quot; &quot;.            !            :   , &nbsp;   ,  ,              ,          : , , , ,     .     ,    ,    -      !</p>\r\n\r\n<p>     &quot; &quot;   :                :   ,     .     -      , &nbsp;   .          .     !  !    19:00!</p>\r\n\r\n<p> ,    ,            ,    &hellip;    -     !</p>\r\n\r\n<p>&quot; &quot; -        .     ,     &hellip;      -     !   ,          ,    &quot; &quot;.</p>\r\n','2013-03-12 17:10:08','2013-03-15 18:47:54'),(387,129,'en','Black Piglet','<p>In one of the oldest parts of the capital, on one of the most picturesque streets of the city, the pub-restaurant <strong>&quot;Black Piglet&quot;</strong> is located. The restaurant is situated on the very location of the famous Kyiv tavern, or to be more exact - the tavern, which gathered the most influential waywodes of the Kievan Rus, and other citizens to resolve their disputes, to discuss important Old Russian affairs and to have high-quality banquets.</p>\r\n\r\n<p>In a cozy room with massive wooden tables, sofas and chairs, as usual for a real tap house, modern lovers of beer will gather. Centuries later, the &quot;Black Piglet&quot; gathers together everybody who knows a lot about good beer. As at that time, today here lingers hopped spirit of fun, fellowship and fraternity.</p>\r\n\r\n<p>&quot;Black Piglet&quot; has three rooms: the main and two for banquets, so it is perfect for a friendly beer parties, conceptual wedding, and for a great variety of celebrations and holidays. In the menu of the restaurant there are the best assets of national cuisines of Germany, Austria, Hungary and Ukraine. The pork is treated with great reverence here. The menu is full of delicious dishes: a variety of meats, special homemade sausages, original and favorite dishes from poultry and fish (and poltavskyi crucian carp, which is sung in the &quot;Aeneid&quot; of Kotlyarevskyi!), as well as vegetarian meals, and, of course, pork knuckle &quot;Aysban&quot;, prepared under the author&#39;s recipe of the chef Oleg Bilous - which you will not find anywhere else in Kyiv!</p>\r\n\r\n<p>The cozy atmosphere of the restaurant &quot;Black Piglet&quot; again and again attracts visitors for companionship, excellent beer and big delicious snacks. That&rsquo;s why - &quot;Do not grunt your happiness!&quot;</p>\r\n','2013-03-12 17:10:08','2013-03-17 15:57:58'),(388,130,'ua',' ','<p>       Boccaccio / .</p>\r\n\r\n<p>    50    .    / Boccaccio       .</p>\r\n','2013-03-12 17:10:17','2013-03-18 13:24:23'),(389,130,'ru',' Boc