ts, not agreeing to a compromise. <strong>Restaurant &quot;Richelieu&quot;</strong> justifiably is the first place in Kiev with which you want to link the brightest moments of your present.</p>\r\n\r\n<p>In order to cross the threshold of <strong>&quot;Richelieu&quot;</strong>, you do not need to invent a separate occasion. Just come for breakfast or lunch, make an appointment or just pop in for a cup of coffee. For guests in the cold season there is a spacious terrace with large bright windows and a cozy lower room. Terrace is perfect for leisurely conversations and negotiations, business lunches and romantic dates. Easy, relaxed atmosphere filled with music and culinary delights will be an excellent addition to almost any event. The lower hall, in turn, is ideal for evening meetings with friends, bright and noisy parties, or, alternatively, important dinner talks, which require special privacy.</p>\r\n\r\n<p>In summer, the hospitality of the <strong>restaurant &quot;Richelieu&quot;</strong> invites to cozy summer terrace. In the center of Kiev you will find five-star comfort in the open air. It sounds more than tempting, especially when you consider that the restaurant has a special program for children. Arriving at &quot;Richelieu,&quot; with a child, you can rest easily: the little guest will have fun and be as comfortable as possible.</p>\r\n\r\n<p>Our doors are always open for you. Believe me, we can appreciate the time and trust of our guests, because we understand the inestimable value of every minute of a happy life.</p>\r\n','2013-03-12 17:11:25','2013-03-16 16:03:32'),(394,132,'ua','','<p> -  -   ,       ,    ,  &#39;      ,       &#39;   . -      :      ,        ,    .</p>\r\n\r\n<p>  ,   1100 ..      500 .     ,    80 , , -  45 ,     ( &#39;,      ).</p>\r\n\r\n<p>     3      .         150 , Vip-   40      30 .</p>\r\n\r\n<p> ,     , &#39;    19.00  22.00   , ,    .     22.00  02.00  &#39;,    Dj   80-90,     .</p>\r\n\r\n<p>            &laquo;&raquo; <