neF&quot; you will find everything you need for a comfortable stay at the highest level. As to the menu, we have assembled the best dishes of European, Asian, Japanese, Jewish, and of course Russian cuisine. Masterpieces of culinary art, recognized around the world will be able to accompany any event - whether business lunch or romantic date. The pleasant surprise is the fact that in the restaurant &quot;TurgeneF&quot; your culinary delight is not limited to the menu presented. The chef will be happy to prepare any dish on the individual order, because it was so accepted in the bazaars of the Empire.</p>\r\n\r\n<p>The lounge restaurant &quot;TurgeneF&quot; has won a special honor thanks to its bright unforgettable evenings, because it is here gather the best talents to please guests with favorite music hits. Professional audio equipment and excellent acoustics will be appreciated by karaoke lovers and grateful audience, among whom there are often the real stars of the stage.</p>\r\n\r\n<p>Following the traditions of the restaurant, we appreciate the warmth and comfort of each guest, and therefore have created a unique private room. It differs markedly from the usual VIP-rooms, as it is, rather, a separate private restaurant. It has not only a banquet hall for 12 persons, but also its own lounge area with soft comfortable sofas and a private washroom - all you need for a secluded holiday. During your event the best waiters and sommeliers will work. They will make your stay more comfortable and memorable. And in order that the staff did not bother you during an important event, you can use the convenient system of calling of a waiter or an internal telephone.</p>\r\n\r\n<p>Private room is also excellent for companies that like to relax with songs and a great mood. Own karaoke system and premium sound insulation will create a truly unique and friendly atmosphere in which there will be only you and your favorite hits.<br />\r\nConceiving this room, we tried to make it so that it becomes your favorite corner in the city of endless meetings and negotiations. So even if you just want to stay in silence and solitude - come to us! In the private room we have placed a large aquarium with reef fish. After all, what could be better in the short break between important things than a piece of the ocean and absolute rest.</p>\r\n\r\n<p><span style=\"line-height: 1.6em;\">Plan the important events of your life along with a lounge-restaurant &quot;TurgeneF.&quot; Contacting the administrator, you can book a table or order a corporate event. Following the ancient Russian tradition, the restaurant &quot;TurgeneF&quot; is ready to offer the best conditions for your celebration.</span></p>\r\n','2013-03-12 17:15:15','2013-03-15 18:43:46'),(403,135,'ua','   ','<p>     BRS (. )      &laquo;  &nbsp;&raquo;  . .</p>\r\n\r\n<p>    &laquo;  &nbsp;&raquo;       :    ,  &#39;   ...</p>\r\n\r\n<p>  , ,    -        - ... ,  ,  !</p>\r\n','2013-03-12 17:17:23','2013-03-18 13:11:42'),(404,135,'ru','   ','<p>     BRS (. )    <strong>  &laquo;   &raquo;</strong>  . .</p>\r\n\r\n<p>    <strong>&laquo;   &raquo;</strong>       :    ,    ...</p>\r\n\r\n<p>  , ,    -        -... ,  ,  !</p>\r\n','2013-03-12 17:17:23','2013-03-17 15:41:03'),(405,135,'en','Barkas Fish and Wine','<p>The largest restaurant chain in the Crimea BRS (Sevastopol) is the author&#39;s project Sea restaurant &quot;Barkas fish and wine&quot; in Kiev.</p>\r\n\r\n<p>Black Democrat kitchen restaurant &quot;Barkas Fish and Wine&quot; offers the best of a variety of colorful Crimean menu: Black Sea fish and seafood, succulent meats and cheeses ...</p>\r\n\r\n<p>Sunny Crimean vegetables, herbs, berries and fruits - great ingredients for implementation of the most delicious ideas chef ... And, of course, the Crimean wine!</p>\r\n','2013-03-12 17:17:23','2013-03-18 13:11:42'),(406,136,'ua','','<p>         &laquo; &raquo;.     , ,       ,       . ,     &#39;.          .   -    ,   ,           .   ,  - 