r: rgb(0, 0, 0); font-family: Arial, Helvetica; line-height: 18px;\">&nbsp;   ,      .&nbsp;</span><em style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica; line-height: 18px;\"> buddha-bar</em><span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica; line-height: 18px;\">&nbsp;    ,          .        .    -  ,  ,    ,   ,  ,   , ,   ,  .          .               &quot;</span><em style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica; line-height: 18px;\">buddha-bar</em><span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica; line-height: 18px;\">&quot;. ,            ,       &ndash; ,  ,         .&nbsp;   &quot;buddha-bar&quot;   VIP-,         .&nbsp;</span></p>\r\n\r\n<p style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica; font-size: 13px; line-height: 18px;\"><strong> BUDDHA-BAR</strong>&nbsp;&nbsp;     ,          .    Fushion Asia &ndash;  ,        .      , ,    ,    .  ,    ,     &quot;<em>buddha-bar</em>&quot;    .           &quot;<em>buddha bar</em>&quot;,         . ,  &nbsp;<strong>Buddha bar </strong>,       ,     ,       ,   ,     ,     ,   &quot;&quot;,    -:  &nbsp;<strong><em>Buddha bar</em></strong>,   &ldquo; &rdquo;, &ldquo;   &rdquo;.    &ndash;      .            . ,  ,   ,           .&nbsp;</p>\r\n','2013-03-12 17:34:20','2013-03-15 16:44:24'),(429,143,'en','Buddha Bar','<p>The first <strong>&ldquo;Buddha-bar&rdquo;</strong> in the world was opened in 1996 in Paris. The concept and the idea belong to Raymond Visan. Until now the glamorous Buddha&rsquo;s residence not only hasn&rsquo;t lost its popularity but got brilliant twins in the largest cities of the world: Dubai, Beirut, Cairo. In 2008 &ldquo;Buddha-bar&rdquo; appeared in Kiev.&nbsp;</p>\r\n\r\n<p>Permanent customers of <strong>&ldquo;Buddha-bar&rdquo;</strong>, no matter in what part of the world it is, are Rod Stewart, Madonna, Johnny Depp, Cameron Dias, Jennifer Lopez and many other world-known celebrities.&nbsp;</p>\r\n\r\n<p>In 2008 <strong>&ldquo;Buddha-bar&rdquo;</strong> lounge-restaurants opened their doors for guests not only in Kiev, but also in Prague, London and Jakarta.&nbsp;</p>\r\n\r\n<p>In every country the interior of &ldquo;Buddha-bar&rdquo; always meets some particular conditions: presence of a huge Buddha&rsquo;s statue, original chandeliers and marvelous artifacts. The cuisine also corresponds to the general standard which is Asian Fusion tune. Though the cuisine of <strong>&ldquo;Buddha-bar&rdquo; in Kiev</strong> is adapted for Europe &ndash; it is less spicy.&nbsp;</p>\r\n\r\n<p>All the dishes in the menus of <strong>&ldquo;Buddha-bar&rdquo;</strong> lounge-restaurants are approved by the management and the chef of &ldquo;Buddha-bar&rdquo; in Paris. Absolutely all the lounge-restaurants of &ldquo;Buddha-bar&rdquo; network keep to their traditions. One of them is &ldquo;Family concept&rdquo;, which means that all guests are offered to place the ordered dishes in the middle of the table in order to share them with their company. Usually customers don&rsquo;t stay for a long time at their table, they leave it after dinner and go to the lounge-area Mezzanine to enjoy the magical atmosphere listening to the original DJ tracks.&nbsp;</p>\r\n\r\n<p>In every restaurant of the network you can find your own island of seclusion, comfort and hospitality. Kiev <strong>lounge-restaurant &ldquo;Buddha-bar&rdquo;</strong> completely corresponds to all the demands of the world &ldquo;Buddha-bar&rdquo; network, though it is much larger than all the other restaurants (1400 sq. m), it has more than 350 persons capacity. The main distinction which differs Kiev &ldquo;Buddha-bar&rdquo; from its twins is three level premises &ndash; restaurant, bar and lounge-area Mezzanine, and also a VIP-zone with a unique view of the Buddha statue.&nbsp;</p>\r\n\r\n<p><strong>Kiev &ldquo;Buddha-bar&rdquo;</strong> hosts the brightest events of the year and is considered to be the favorite party place of the show-business stars and 